;\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class="" style="text-align:justify;"><b style="mso-bidi-font-weight:\r\nnormal;"><span style=""><span style="">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></b><span style="mso-bidi-font-style:italic;">As\r\nwe know that â€œHealth is Wealth. As the technology is increasing day by day\r\nthere is a revolution in electronic goods there is also a revolution in\r\neffective treatment provided to the patient but the problem here is giving\r\ntreatment to the patient in time. These <span style="font-weight: bold;">treatments are valid when they are\r\nprovided to the patient in time.</span></span><span style=""></span></p>\r\n\r\n<p class="" style="text-align:justify;"><span style="mso-bidi-font-style:italic;">Here <span style="font-weight: bold;">we designed a new project which is mainly\r\nconcentrated to the patients with cardiac diseases</span>. For that purpose here we\r\nare considering <span style="font-weight: bold;">Heart Beat, blood pressure and body temperature</span> are the main\r\nfactors. The continuous monitoring of these parameters is done here. If these\r\nparameters are within the normal range than continuous monitoring takes place,\r\notherwise the abnormal situation is intimated to the patient caretaker and\r\ndoctor through SMS using GSM. So that they can respond immediately and\r\ntreatment is provided to the patient with in time.</span></p></div></div></div><div class="block" data-category="text" data-children="" data-id="3" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: Roboto Condensed;">ACADEMIC MINI PROJECT</p></td><td class="block-title"></td></tr></tbody></table><div class="block-in