lse"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Emphasis"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="31" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Subtle Reference"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="32" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Intense Reference"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="33" SemiHidden="false"\r\n   UnhideWhenUsed="false" QFormat="true" Name="Book Title"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="37" Name="Bibliography"></w:LsdException>\r\n  <w:LsdException Locked="false" Priority="39" QFormat="true" Name="TOC Heading"></w:LsdException>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Table Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-qformat:yes;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin-top:0in;\r\n	mso-para-margin-right:0in;\r\n	mso-para-margin-bottom:10.0pt;\r\n	mso-para-margin-left:0in;\r\n	line-height:115%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-fareast-font-family:"Times New Roman";\r\n	mso-fareast-theme-font:minor-fareast;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:"Times New Roman";\r\n	mso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->\r\n\r\n</p><p class="" style="text-align: center;"><span style="">Design and\r\ndevelopment of online collaboration <span style="font-weight: bold;">platform between students and faculties.</span> Student\r\nhas provision to comment or ask questions on any topic discussed in the class.\r\nCorresponding faculty can reply to the queries online anytime. Status of each\r\nqueries are tracked till closure. </span></p>\r\n\r\n</div></div></div><div class="block" data-category="text" data-children="" data-id="4" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: Roboto Condensed;">Technical Skills</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content">Programing Languages&nbsp; : <span style="font-weight: bold;">C, Java</span><br>Office Tools &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; : <span style="font-weight: bold;">MS Office</span><br>Web Development&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : <span style="font-weight: bold;">HTML</span></div></div></div><div class="block" data-category="text" data-children="" data-id="5" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: Roboto Condensed;">Achievements</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><ul><li>Participated in a workshop on<span style="font-weight: bold;"> PCB design</span></li><li>Participated in a<span style="font-weight: bold;"> workshop of Skill Development Program </span>Conducted by<span style="font-weight: bold;"> AP</span> Government</li><li>participated in <span style="font-weight: bold;">DST Sponsored Two day National Seminar on Smart Antenna Technologies for Wireless Systems, Trends &amp; Technologies</span></li></ul></div></div></div><div class="block" data-category="text" data-children="" data-id="6" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: Roboto Condensed;">Extra curricular Activities</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><ul><li>Participated certificates of NSS activities.</li><li>Acted as a member of event organizers MICFEST 2K11, 12, 13 &amp; 14 played an active role in the success of it.</li><li>participated in workshops &amp; seminars conducted in my college.<br></li></ul></div></div></div><div class="block" data-category="text" data-children="" data-id="7" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: Roboto Condensed;">Strengths</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><ul><li>Hard working and adaptable to any environment</li><li>Willingness to learn and positive attitude</li><li>Working in a team</li><li>Patience<br></li></ul></div></div></div><div class="block" data-category="text" data-children="" data-id="8" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: Roboto Condensed;">Declaration</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><p>I here by declare that the information given above is true to the best of my knowledge and can assure the best of commitment &amp; productivity.<br></p></div></div></div></div>', 'Saved', '2016-12-09 09:58:31', 0, '0', '0', '0', '', 1);
