chool Examination</p><p class="sub-where">Siddartha High School, Karimnagar</p><p class="sub-dates">2009</p><div class="html-content"></div></div></div></div><div class="block" data-category="text" data-children="" data-id="3" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Skills</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><p>HDL - Verilog.</p><p>HDVL - System Verilog.</p><p>Scripting - Basic Perl.</p><p>Bus protocols - UART,SPI</p><p>Tools - Xilinx ISE, Questasim</p><p>Operating System - Windows,Linux.</p><p>Knowledge on FPGA Prototyping (Spartan-3E).</p></div></div></div><div class="block" data-category="text" data-children="" data-id="4" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Projects</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><p>1 . Developing SystemVerilog verification environment for &nbsp;write/read memory.</p><p>Tools used: QuestaSim</p><p>Description: The memory DUT has been verified for all possible configurations which are drive data to DUT, read data from dut with random stimulus generator. The verification environment is developed in SystemVerilog and DUT is designed in Verilog HDL. The address bit for memory is four bit and data is 32bit.</p><p>Role :</p><p>ïƒ˜ Design using Verilog HDL.</p><p>ïƒ˜ Development of stimulus generator which transfers the data in terms of packets.</p><p>ïƒ˜ Development of Input and Output Interfaces with respect to DUT.</p><p>ïƒ˜ Development of components like Generator, Driver, Input, Output Monitors and Scoreboard.</p><p>ïƒ˜ Simulation &amp; debugging of test cases using Questasim simulator.</p></div></div></div><div class="block" data-category="text" data-children="" data-id="5" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Traits</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><p>ïƒ˜ Self-motivation</p><p>ïƒ˜ Good communication skills</p><p>ïƒ˜ Dedicated and hardworking</p></div></div></div><div class="block" data-category="text" data-children="" data-id="6" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Interests</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><p>ïƒ˜ Finding new and upcoming gadget technologies</p><p>ïƒ˜ Playing Cricket</p></div></div></div><div class="block" data-category="text" data-children="" data-id="7" style="margin-bottom: 1em;"><table class="wide title" cellspacing="0"><tbody><tr><td class="block-title"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Personal Details</p></td><td class="block-title"></td></tr></tbody></table><div class="block-inner"><div class="html-content"><p>Fatherâ€™s Name &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: &nbsp;Ramesh</p><p>Date of Birth &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: &nbsp;16, August 1994 &nbsp; &nbsp; &nbsp;</p><p>Permanent Address &nbsp; &nbsp; &nbsp; : &nbsp; H No:LIG 174,</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Road no.2 KPHB Colony,</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Hyderabad,</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbs