m: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Additional Information</p><div class="block-inner"><div class="html-content"><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Having 3.4 years of good exposure in <b>Administering and Developing </b>in <b>Sales forces CRM</b>.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Worked on the\r\ndesigning of Custom Objects, Custom Tabs, custom fields, role based Page\r\nLayouts, Custom Reports, and Report Folders.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">&nbsp;Report extractions to various formats, design\r\nof Visual Force Pages.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Dashboards used\r\nfor various other components as per the client and application requirements.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Created the\r\nValidation Rules, Approval Process, workflows for automated lead routing, lead\r\nescalation and Email Alerts. <o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Extensive business</span><span style="">\r\nknowledge&nbsp; and&nbsp; customization&nbsp;\r\nexperience&nbsp; on&nbsp; various </span><span style="">salesforce</span><span style="">.com\r\n</span><span style="">standard objects like Accounts,&nbsp; Contacts,&nbsp;\r\nOpportunities, Products and Price</span><span style="">&nbsp;&nbsp;\r\nbooks,&nbsp;&nbsp; Cases,&nbsp;&nbsp; Leads,&nbsp;&nbsp;\r\nCampaigns,&nbsp;&nbsp; Forecasting</span><span style="">,\r\nReports </span><span style="">and</span><span style="">\r\nDashboards.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Defined lookup\r\nand master-detail relationships on the objects and created junction objects to\r\nestablish connectivity among objects.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Designed various WebPages\r\nin Visual Force for functional needs within Sales force. <o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Designed and\r\ndeveloped Apex Triggers for various functional needs in the application.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Involved in Unit\r\nTesting and Test Coverage for triggers.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Used Data Loader for insert, update, and bulk\r\nimport or export of data from Salesforce.com Objects. Used it to read, extract,\r\nand load data from comma separated values (CSV) files.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Interacted with\r\nvarious business team members to gather and documented the requirements.\r\nImplemented the requirements on Salesforce.com platform and Force.com IDE\r\nPlug-in using Eclipse.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Created&nbsp; Profiles,&nbsp;\r\nRoles&nbsp; based&nbsp; on&nbsp;\r\nOrganization&nbsp; role&nbsp; hierarchy&nbsp;\r\nand&nbsp;&nbsp; implemented Record-Level and\r\nField-Level security&nbsp; and&nbsp; configured&nbsp;\r\ntheir sharing settings.<o:p></o:p></span></p>\r\n\r\n<p class="" style="text-align: justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span style="">Working&nbsp; with&nbsp; Operations&nbsp;\r\nManager&nbsp; and&nbsp; users&nbsp;\r\nto&nbsp; determine&nbsp;&nbsp; business&nbsp;&nbsp;\r\nrequirements,&nbsp; provide&nbsp; administrative&nbsp; support&nbsp;\r\nand&nbsp; design&nbsp;&nbsp; /implement solutions in Salesforce.com CRM.<o:p></o:p></span></p></div></div></div><div class="block" data-category="experience" data-children="1" data-id="2" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Work Experience</p><div class="block-inner"><div class="last-child" data-id="2c0" data-category="experience" style="margin-bottom: 1em;"><p class="sub-title" style="font-family: &quot;Roboto Condensed&quot;;">Sales Force Developer</p><p class="sub-where"><span class="company">TCS</span>, Bangalore</p><div class="html-content"></div></div></div></div><div class="block" data-category="education" data-children="1" data-id="3" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Education</p><div class="block-inner"><div class="last-child" data-id="3c0" data-category="education" style="margin-bottom: 1em;"><p class="sub-title" style="font-family: &quot;Roboto Condensed&quot;;">BCA</p><p class="sub-where">SVU, Tirupathi</p><p class="sub-dates">2008 â€“ 2011</p><div class="html-content"><p>Graduated BCA( Bachelor Of Computer Application) Affiliated To Sri Venkateswara University, Tirupathi.&nbsp;</p></div></div></div></div><div class="block" data-category="education" data-children="1" data-id="4" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Education</p><div class="block-inner"><div class="last-child" data-id="4c0" data-category="education" style="margin-bottom: 1em;"><p class="sub-title" style="font-family: &quot;Roboto Condensed&quot;;">MCA</p><p class="sub-where">JNTU-A, Gudur</p><p class="sub-dates">2011 â€“ 2014</p><div class="html-content"><p>Post Graduated MCA(Master Of Computer Applications) Affiliated to Jawaharlal Nehru Technological University -Ananthapur.</p></div></div></div></div><div class="block" data-category="text" data-children="" data-id="5" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Skills</p><div class="block-inner"><div class="html-content"><p class="" style=""><b><span style="">Skill Set:</span></b><span style=""><o:p></o:p></span></p><p class="" style="text-align:justify;">CRM<span style="font-weight: bold;"> </span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Salesforce.com<o:p></o:p></p><p class="" style="text-align:justify;">SFDC\r\nTechnologies &nbsp; &nbsp; &nbsp;:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Apex language, visual force<o:p></o:p></p><p class="" style="text-align:justify;"><span style="">SFDC\r\nTools &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :<b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</b>Eclipse,\r\nForce.com Eclipse IDE Plug-in,</span><o:p></o:p></p><p class="" style="text-align:justify;"><span style="">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Apex,\r\nData Loader, Import Wizard </span><o:p></o:p></p><p class="" style="text-align:justify;"><span style="">Operating\r\nSystem &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: &nbsp; &nbsp; &nbsp; &nbsp;Windows XP, 7, 8</span><o:p></o:p></p><p class="" style="text-align:justify;"><span style="">Database &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : &nbsp; &nbsp; &nbsp; &nbsp;Oracle</span><o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="" style="text-align:justify;"><span style="">Web\r\nTechnologies &nbsp; &nbsp; &nbsp; &nbsp;: &nbsp; &nbsp; &nbsp; &nbsp;HTML</span><o:p></o:p></p></div></div></div><div class="block" data-category="text" data-children="" data-id="6" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Projects</p><div class="block-inner"><div class="html-content"><p class="" style="text-align:justify;"><o:p>&nbsp;</o:p></p><p class="" style="text-align:\r\njustify;"><b><span style="">Project#3:<o:p></o:p></span></b></p><p class="" style="text-align:\r\njustify;"><b><span style=""><o:p>&nbsp;</o:p></span></b></p><p class="" style=""><b><span lang="EN-IN" style="">Project name: OrderZone.<o:p></o:p></span></b></p><p class="" style=""><b><span lang="EN-IN" style="">Team Size: 5<o:p></o:p></span></b></p><p class="" style=""><b><span lang="EN-IN" style="">Role: Developer.<o:p></o:p></span></b></p><p class="" style=""><b><span lang="EN-IN" style="">Environment: Apex classes,\r\nApex Triggers, Visual force pages,<o:p></o:p></span></b></p><p class="" style=""><b><span lang="EN-IN" style="">Force.com IDE, Data loader.<o:p></o:p></span></b></p><p class="" style=""><b><span lang="EN-IN" style=""><o:p>&nbsp;</o:p></span></b></p><p class="" style="text-align:\r\njustify;"><b><span lang="EN-IN" style="">Description:</span></b><span lang="EN-IN" style=""> Through OrderZone, multi suppliers can represent their products so that\r\nbuyer can get benefits of OrderZone. It contains two modules, Customer Module\r\nand Supplier Module. Through Customer Module customer can track the benefits of\r\nshopping through OrderZone. Through Supplier module, different suppliers can\r\ncompare different competitor goods to optimize the price of goods of a\r\nparticular supplier. OrderZone helps to create an integrated supply chain by\r\nbringing simplicity to B2B and B2C supply chain management and business\r\nprocurement.<o:p></o:p></span></p><p class="" style=""><span lang="EN-IN" style="">&nbsp;</span></p><p class="" style=""><b><span lang="EN-IN" style="">Responsibilities<o:p></o:p></span></b></p><p class="" style=""><span lang="EN-IN" style=""><o:p>&nbsp;</o:p></span></p><p class="" style=""><!--[if !supportLists]--><span lang="EN-IN" style="">Ã˜<span style="">&nbsp; </span></span><!--[endif]--><span lang="EN-IN" style="">Worked on Apex Data Loader.<o:p></o:p></span></p><p class="" style=""><!--[if !supportLists]--><span lang="EN-IN" style="">Ã˜<span style="">&nbsp; </span></span><!--[endif]--><span lang="EN-IN" style="">Involved in creation of Objects, Relationships, Page\r\nlayouts, Record Types, Custom<o:p></o:p></span></p><p class="" style=""><span lang="EN-IN" style="">Settings, Validation Rules, Email Templates, Workflow\r\nRules and Approval process.<o:p></o:p></span></p><p class="" style=""><!--[if !supportLists]--><span lang="EN-IN" style="">Ã˜<span style="">&nbsp; </span></span><!--[endif]--><span lang="EN-IN" style="">Worked on Administration setup like Creating Users,\r\nRoles and Sharing Settings.<o:p></o:p></span></p><p class="" style=""><!--[if !supportLists]--><span lang="EN-IN" style="">Ã˜<span style="">&nbsp; </span></span><!--[endif]--><span lang="EN-IN" style="">Responsible for migrating data from one Sandbox\r\nenvironment to another Sandbox<o:p></o:p></span></p><p class="" style=""><span lang="EN-IN" style="">environment using Force.com IDE tool.<o:p></o:p></span></p><p class="" style=""><!--[if !supportLists]--><span lang="EN-IN" style="">Ã˜<span style="">&nbsp; </span></span><!--[endif]--><span lang="EN-IN" style="">Involved in customization on Apex triggers, Apex\r\nclasses, and Visual Force pages.<o:p></o:p></span></p><p class="" style=""><!--[if !supportLists]--><span lang="EN-IN" style="">Ã˜<span style="">&nbsp; </span></span><!--[endif]--><span lang="EN-IN" style="">&nbsp;Responsible for\r\nwriting Test Cases for various scenarios.<o:p></o:p></span></p><p class="" style=""><!--[if !supportLists]--><span lang="EN-IN" style="">Ã˜<span style="">&nbsp; </span></span><!--[endif]--><span lang="EN-IN" style="">Responsible for preparing Technical Document.<o:p></o:p></span></p><p class="" style="text-align:\r\njustify;"><b><span style=""><o:p>&nbsp;</o:p></span></b></p><p class="" style="text-align:\r\njustify;"><b><span style="">Project#2:<o:p></o:p></span></b></p><p class="" style="text-align:\r\njustify;"><b><span style=""><o:p>&nbsp;</o:p></span></b></p><p class="" style="text-align:\r\njustify;"><b><span style="">Client&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Roche </span></b><span style=""><o:p></o:p></span></p><p class="" style="text-align:\r\njustify;"><b><span style="">Role&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : SFDC Developer</span></b><span style=""><o:p></o:p></span></p><p class="" style="text-align:\r\njustify;"><b><span style="">Environment&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Salesforce.com/Apex/Visual force (Mostly\r\nAdmin)<o:p></o:p></span></b></p><p class="" style="text-align:\r\njustify;"><o:p>&nbsp;</o:p></p><p class="" style="text-align:\r\njustify;"><b><span style="">Description&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span></b><span style=""> Roche is the largest\r\nprivate operator of health care facilities in the world. It is based in Basel,\r\nSwitzerland and is widely considered to be the single largest factor in making\r\nthat city a hotspot for healthcare enterprise<o:p></o:p></span></p><p class="" style="text-align:justify;"><b><span style="">Responsibilities&nbsp; :</span></b><span style=""><o:p></o:p></span></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Understanding\r\nthe business logic and preparation of technical design document. </span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Preparation\r\nof the data model. </span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Customize\r\nand configure the application. </span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Creating\r\nWorkflows, Objects and Validation Rules inside Sales force and Mapping them to\r\nthe existing functionalities and Objects.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Implement\r\nthe complex business logic using Apex and Visual force.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Customizing\r\nrecords types, fields, tabs, column fields, item options, forms and setup\r\nconfiguration.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Creating\r\nand manage Users, Roles, Profiles, permissions, mass updates and renaming\r\nrecords.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Generating\r\nup to date Reports.</span><o:p></o:p></p><p class="" style=""><span lang="EN-IN" style=""><o:p>&nbsp;</o:p></span></p><p class="" style="text-align:justify;"><b><span style="">Project#1:<o:p></o:p></span></b></p><p class="" style="text-align:\r\njustify;"><b><span style="">Client&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Booth\r\nLeads </span></b><span style=""><o:p></o:p></span></p><p class="" style="text-align:\r\njustify;"><b><span style="">Role&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : SFDC Developer</span></b><span style=""><o:p></o:p></span></p><p class="" style="text-align:\r\njustify;"><b><span style="">Environment&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Salesforce.com/Apex/Visual force</span></b><span style=""><o:p></o:p></span></p><p class="" style=""><o:p>&nbsp;</o:p></p><p class="" style="text-align:justify;"><b><span style="">Description&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span></b><span style=""> Booth\r\nLeads is a user-friendly mobile app that lets you capture leads at events by\r\nscanning the QR codes on attendee badges. This App supports both Android and IPhone\r\ndevices.</span><o:p></o:p></p><p class="" style="text-align:justify;"><b><span style="">Features:</span></b><span style=""><o:p></o:p></span></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Scan\r\nQR codes and convert them to leads.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Store\r\nleads from events in your mobile.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Send\r\nleads instantly to web portal.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Rate\r\nleads as Hot or Cold.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Make\r\nnotes about each lead you scan.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Send\r\nan email to a lead with your business details.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Forward\r\nlead details as an attachment to any one in CSV format.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Set a\r\nreminder to follow-up with a lead.</span><o:p></o:p></p><p class="" style="text-align:\r\njustify;"><span style=""><o:p>&nbsp;</o:p></span></p><p class="" style="text-align:\r\njustify;"><o:p>&nbsp;</o:p></p><p class="" style="text-align:\r\njustify;"><b><span style="">Responsibilities</span></b><b><span style="">:\r\n</span></b><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Developed\r\nvarious Custom Objects, Tabs, Custom Fields, Visual Force Pages and Controllers</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Administered,\r\nconfigured, maintained Salesforce.com application user profiles, roles,\r\nassigning Permissions, generating security tokens, validation Rule.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Created\r\nand deployed Several Reports using salesforce.com platform.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Developed\r\nAPEX Classes, Controller Classes for various functional needs in the\r\napplication.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Written\r\nSOQL queries against force.com API.</span><o:p></o:p></p><p class="" style="text-align:justify;"><!--[if !supportLists]--><span style="">âž¢<span style="">&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="">Involved\r\nin Salesforce.com application setup activities and customized the apps to match\r\nthe functional needs of the organization.</span><o:p></o:p></p><p class="" style="text-alig