server Health Check activities\r\nper the Microsoft recommendations.<br></li><li>Played the role of innovation champion for our team\r\nand Performed innovations/automations.<br></li><li>Experienced in the certificate installations when\r\nexpired.<br></li><li>Experienced in BizTalk development using\r\norchestrations, pipelines, mappings, schemas and also experience in BizTalk\r\nadministration.<br></li><li>Good knowledge in BizTalk server installation and\r\nmigration.<br></li><li>Experienced in building Disaster recovery, Incident\r\nmanagement.<br></li><li><span style="font-weight: bold;">Microsoft BizTalk server\r\n2010 certification (MCTS).</span><br></li><li>Good knowledge in Akana (SOA) policy manager 6.x and\r\nall virtualization concepts and Experience in SOA installation, Upgradation\r\n&amp; Migration.<br></li></ul><p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class="" style="text-align:justify;"></p><ul><li>Excellent team player and\r\nself-motivated.<br></li></ul><p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</div></div></div><div class="block" data-category="text" data-children="" data-id="1" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Skills</p><div class="block-inner"><div class="html-content"><table class="" border="1" cellspacing="0" cellpadding="0" style="">\r\n <tbody><tr style="">\r\n  <td width="183" valign="top" style="">\r\n  <p class="" style=""><span style="font-weight: bold;">Middleware Technologies</span><span style=""><o:p></o:p></span></p>\r\n  </td>\r\n  <td width="435" valign="top" style="">\r\n  <p class="" style=""><span style="mso-bidi-font-weight:bold;">Microsoft\r\n  BizTalk Server 2006, BizTalk Server 2010</span><span style=""><o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n <tr style="">\r\n  <td width="183" valign="top" style="">\r\n  <p class="" style=""><span style=""><span style="font-weight: bold;">Databases</span><o:p></o:p></span></p>\r\n  </td>\r\n  <td width="435" valign="top" style="">\r\n  <p class="" style=""><span lang="FR" style="">SQL server 2012, SQL server 2008 R2</span><span style="mso-bidi-font-weight:bold;"><o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n <tr style="">\r\n  <td width="183" valign="top" style="">\r\n  <p class="" style=""><span style=""><span style="font-weight: bold;">Software Tools</span><o:p></o:p></span></p>\r\n  </td>\r\n  <td width="435" valign="top" style="">\r\n  <p class="" style=""><span lang="FR" style="">SOA service manager 5.2, SOA policy manager\r\n  6.x, Informatica 9.x.</span><span style="mso-bidi-font-weight:bold;"><o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n <tr style="">\r\n  <td width="183" valign="top" style="">\r\n  <p class="" style=""><span style=""><span style="font-weight: bold;">Operating Systems</span><o:p></o:p></span></p>\r\n  </td>\r\n  <td width="435" valign="top" style="">\r\n  <p class="" style=""><span lang="FR" style="">Windows server 2008 R2<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table></div></div></div><div class="block" data-category="text" data-children="" data-id="2" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Certifications</p><div class="block-inner"><div class="html-content"><table class="" border="1" cellspacing="0" cellpadding="0" style="">\r\n <tbody><tr style="">\r\n  <td width="183" valign="top" style="">\r\n  <p class="" style=""><span style=""><span style="font-weight: bold;">Certification</span><o:p></o:p></span></p>\r\n  </td>\r\n  <td width="435" valign="top" style="">\r\n  <p class="" style=""><span lang="FR" style="">Microsoft BizTalk Server\r\n  2010 Certified<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table></div></div></div><div class="block" data-category="experience" data-children="1" data-id="3" style="margin-bottom: 1em;"><div id="section-toolbar" class="section-toolbar" style="display: none; width: 537px; margin-top: -28.7px; margin-right: -6px; right: 0px; left: 0px;"><button class="btn btn-mini btn-default edit" style="display: none;">Edit</button><button class="btn btn-mini btn-default rename" style="display: inline-block;">Edit Title</button><button class="btn btn-mini btn-default add-new" style="display: inline-block;">Add Subsection</button><button class="btn btn-mini btn-default move-section" style="display: inline-block;">Move</button><button class="btn btn-mini btn-default delete" style="display: inline-block;"><i class="fa fa-trash-o"></i></button></div><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Work Experience</p><div class="block-inner"><div class="last-child" data-id="3c0" data-category="experience" style="margin-bottom: 1em;"><div id="subsection-toolbar" class="subsection-toolbar" style="display: none; top: 543.813px;"><button class="btn btn-mini btn-default edit">Edit</button><button class="btn btn-mini btn-default move-subsection">Move</button><button class="btn btn-mini btn-default delete"><i class="fa fa-trash-o"></i></button></div><p class="sub-title" style="font-family: &quot;Roboto Condensed&quot;;">BizTalk Administrator</p><p class="sub-where"><span class="company">Cognizant Technology Solutions </span>, Chennai</p><p class="sub-dates">Oct 2011 â€“ Current</p><div class="html-content"><p class="" style=""></p><div><p style=""><v:shapetype coordsize="21600,21600" o:spt="202" path="m,l,21600r21600,l21600,xe">\r\n <v:stroke joinstyle="miter">\r\n <v:path gradientshapeok="t" o:connecttype="rect">\r\n</v:path></v:stroke></v:shapetype><v:shape type="#_x0000_t202" style="" fillcolor="#dbe5f1" stroked="f">\r\n <v:textbox>\r\n  <!--[if !mso]-->\r\n  </v:textbox></v:shape></p><p class="" style=""><b><span style="">&nbsp;Project</span></b><span style="mso-bidi-font-weight:bold;">: LN\r\nShared Services</span><span style=""><o:p></o:p></span></p>\r\n\r\n<p class="" style=""><b><span style="">&nbsp;Client: </span></b><span style="">Lexis Nexis,\r\nAustralia<o:p></o:p></span></p>\r\n\r\n<p class="" style=""><b><span style="">&nbsp;</span></b><b><span style="mso-bidi-font-style:italic;">Period</span></b><span style="mso-bidi-font-style:italic;"> : </span><span style="">Oct 2011 â€“ Dec\r\n2012</span></p><p class="" style=""><span style=""><br></span></p><p class="" style=""><span style="font-weight: 700;"><o:p>&nbsp;</o:p></span><span style="font-weight: 700;">Roles and Responsibilities:</span><span style=""><br></span></p></div><ul><li>Developed,\r\nexecuted and tested BizTalk applications.<br></li><li>Designed,\r\ncreated and configured BizTalk schemas and pipelines.<br></li><li>Performed\r\ndaily/weekly/quarterly monitoring activities to maintain the stability of the\r\nserver.<br></li><li>Supported\r\nBizTalk and implemented enterprise integration patterns.<br></li><li>Analyzed and\r\nexecuted BizTalk server applications to multiple customers.<br></li><li>Conducted\r\nroutine maintenance tasks including security patches and service installation.<br></li><li>Configured BAM\r\napplications on servers and systems.<br></li><li>Integrated\r\nvarious application components and updated BizTalk applications<br></li></ul><div><br></div><div><p class="" style=""><b><span style="">Project\r\n:</span></b><span style="mso-bidi-font-weight:bold;"> LN FTK</span><span style=""><o:p></o:p></span></p>\r\n\r\n<p class="" style=""><b><span style="">Client &nbsp;&nbsp;: </span></b><span style="">Lexis Nexis, Australia<o:p></o:p></span></p>\r\n\r\n<p style=""><span style="mso-bidi-font-style:italic;">Period &nbsp;: Jan 2012 â€“ Sep 2012<o:p></o:p></span></p><p style=""><span style="mso-bidi-font-style:italic;"><br></span></p><p style=""><span style="font-weight: 700;"><o:p>&nbsp;</o:p></span><span style="font-weight: 700;">Roles and Responsibilities:</span><span style="mso-bidi-font-style:italic;"><br></span></p><p class="" align="left" style=""></p><ul><li>Built the Disaster recovery environment<br></li><li>Involved in LIVE DR exercise, backed up the jobs\r\nfrom the Production into disaster recovery and monitoring of those jobs.<br></li><li>Installation of all the applications from PROD\r\ninto DR.<br></li><li>Migrated the applications from BizTalk 2006 to\r\nBizTalk 2010<br></li><li>Installation of the application packages and\r\ncomponents in the BizTalk 2010.<br></li><li>BAM monitoring, SQL jobs monitoring and taking\r\nthe necessary action if needed.</li></ul><p></p><p style=""><b><span style="mso-bidi-font-style:italic;"><br></span></b></p><p style=""><b><span style="mso-bidi-font-style:italic;">Project </span></b><span style="mso-bidi-font-style:italic;">: Amgen ARM DTP<o:p></o:p></span></p><div>\r\n\r\n<p style=""><b><span style="mso-bidi-font-style:italic;">Client</span></b><span style="mso-bidi-font-style:italic;">&nbsp;&nbsp;&nbsp; : Amgen, US<o:p></o:p></span></p>\r\n\r\n<p style=""><b><span style="mso-bidi-font-style:italic;">Period </span></b><span style="mso-bidi-font-style:italic;">&nbsp;&nbsp;: Oct 2012 â€“ Till date<o:p></o:p></span></p><p style=""><span style="mso-bidi-font-style:italic;"><br></span></p></div><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="" align="left" style=""><b><span style="">Roles\r\nand Responsibilities:</span></b></p><p style=""></p><ul><li>Effective monitoring of 50 BizTalk Applications through\r\nthe BizTalk Administration console.<br></li><li>Evaluated BizTalk servers and implemented preventive\r\naction.<br></li><li>Usage of effective tools like Message Box Viewer,\r\nTerminator tool for monitoring BizTalk server and DB performance.<br></li><li>Worked on bug fixes/enhancements\r\nin case of fault with the existing functionality.<br></li><li>Creation of new\r\napplication, Host instance, Service in IIS, Task schedulers, SSO for the\r\ndeployments.<br></li><li>Configured the ESB\r\nalerts, SCOM alert mechanism for BizTalk in case of faulty behavior.<br></li><li>Identified and resolved problems with SQL profiler and\r\nEvent Viewer.<br></li><li>Conducted periodic\r\nactivities like server maintenance, Access Reviews, Password resets.<br></li><li>BAM monitoring and\r\nperforming daily/weekly/quarterly/half yearly/yearly monitoring activities.<br></li><li>As an Innovation champion\r\ninvolved in account level hackathon event and performed automation for most of\r\nthe daily operations like Automatic\r\ndisabling of Artifacts tracking, Terminating the remote sessions, Finding the\r\ncredentials used in send/receive ports, automatic saving/resuming suspended\r\nmessages, monitoring host instances, Archiving the files.<br></li><li>Performed BizTalk Health Check activities like adjustment of tracking,\r\nPerformance Analysis of BizTalk servers, Host Throttling, Performance analysis\r\nof SQL, Host separation, removing unnecessary items &amp; settings, .NET CLR\r\nThreading settings, Monitoring solution, Deployment process, one isolated\r\nadaptor per application pool.<br></li><li>Received client\r\nappreciations for quick fix of the issues.<br></li></ul><p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</div><p></p><p class="">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p></div></div></div></div><div class="block" data-category="education" data-children="1" data-id="4" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Education</p><div class="block-inner"><div class="last-child" data-id="4c0" data-category="education" style="margin-bottom: 1em;"><p class="sub-title" style="font-family: &quot;Roboto Condensed&quot;;">B.Tech in CSE</p><p class="sub-where">JNTU</p><p class="sub-dates">2007 â€“ 2011</p><div class="html-content"></div></div></div></div></div>', 'Saved', '2016-12-10 07:45:32', 0, '0', '0', '0', '', 1);
