om<br>7842486941</div></div></td></tr></tbody></table><div class="blocks"><div class="block" data-category="text" data-children="" data-id="0" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Career Objective</p><div class="block-inner"><div class="html-content"><p class=""><span lang="EN-US">&nbsp;&nbsp;</span>To associate with an organization which\r\nprogress dynamically and give me a chance to improve my knowledge and enhance\r\nmy skills and be a part of team that work towards the growth of the\r\norganization.</p></div></div></div><div class="block" data-category="text" data-children="" data-id="1" style="margin-bottom: 1em;"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">ACADEMIC QUALIFICATION</p><div class="block-inner"><div class="html-content"><p class=""></p><ol><li>. B.Tech in Electronics and Communication Engineering in SSJ &nbsp; Engineering College(JNTU hyderabad ) with 74.2 %</li><li>.Intermediate in M.P.C in Sri Chaitanya Junior College with 84.5 %</li><li>SSC in Vidhya Bharathi High School with 89.5 %&nbsp;</li></ol><p></p>\r\n\r\n<table class="" border="0" cellspacing="0" cellpadding="0" style="">\r\n <tbody><tr>\r\n  <td width="108" valign="top" style="">\r\n  <p class="" align="center" style="text-align:center;"><br></p></td><td width="119" valign="top" style=""><br></td><td width="123" valign="top" style=""><br></td><td width="112" valign="top" style=""><br></td><td width="71" valign="top" style=""><br></td><td width="94" valign="top" style=""><br></td></tr></tbody></table><p class=""><b><i><u><span lang="EN-US">ACADEMIC PROJECT </span></u></i></b></p>\r\n\r\n<p class="" style="text-align:justify;"><span lang="EN-US">&nbsp;</span></p>\r\n\r\n<p class=""><b><span lang="EN-US">Project title&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;&nbsp; Next generation auto theft prevention of a &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &n