ock contact" data-category="contact" style="margin-bottom: 1em;"><div class="html-content">tanuja.vallabhaneni@gmail.com<br>9000995577</div></div></td></tr></tbody></table><div class="blocks"><div class="block" data-category="text" data-children="" data-id="0" style="margin-bottom: 1em;"><table class="wide"><tbody><tr><td class="left0"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Summary</p></td><td class="right0"><div class="block-inner"></div></td></tr></tbody></table></div><div class="block" data-category="experience" data-children="1" data-id="1" style="margin-bottom: 1em;"><table class="wide"><tbody><tr><td class="left0"><p class="title" style="font-family: &quot;Roboto Condensed&quot;;">Work Experience</p></td><td class="right0"><div class="block-inner"><div class="last-child" data-id="1c0" data-category="experience" style="margin-bottom: 1em;"><div id="subsection-toolbar" class="subsection-toolbar" style="display: none; top: 168.222px;"><button class="btn btn-mini btn-default edit">Edit</button><button class="btn btn-mini btn-default move-subsection">Move</button><button class="btn btn-mini btn-default delete"><i class="fa fa-trash-o"></i></button></div><p class="sub-title" style="font-family: &quot;Roboto Condensed&quot;;"> Quality Analyst</p><p class="sub-where"><span class="company">S&amp;P Global </span></p><p class="sub-dates">Jun 2013 â€“ Current</p><div class="html-content"><ul><li>Promoted from QA1 to QA1A in one a half years, first to get promoted in a batch of 28QAs who joined as entry level QAs that year.<br></li><li style=""><span style="">Conducted formal and informal product design reviews&nbsp;</span>throughout the software development lifecycle to provide input on functional requirements, product designs, schedules and potential issues. Leveraged analytical skills to communicate effectively with software design team, quickly gaining their respect and becoming a valued, â€œgo-toâ€ team member on challenging use cases.</l